import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import Home from "../../view/Home";

const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={Home} />
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
